  function Fun() {
  
    
    fetch(
             `https://www.googleapis.com/youtube/v3/search?&q=${SearchData}&part=snippet&maxResults=70&key=AIzaSyDDE2thMx3nbsAmxnr1fueEHEj7QNjOM_s&type=video`
           )
      .then((Response) => {
        return Response.json();
      })
      .then((Data) => {
        console.log(Data.items[0].snippet);
        SetData(Data.items);
      });
  }

